class Solution:
    def replaceNonCoprimes(self, nums: List[int]) -> List[int]:
        idx = 0
        changed = False
        goBack = False
        backChanged = False

        while True:
            if len(nums) == 1:
                break
            if not goBack:  # go forward
                if idx == len(nums) - 1:
                    if changed:
                        goBack = True
                    else:
                        break
                else:
                    d = gcd(nums[idx], nums[idx+1])
                    if d > 1:
                        nums[idx] = nums[idx] * nums[idx+1] // d
                        changed = True
                        del nums[idx+1]
                    else:
                        if not changed:
                            idx += 1
                        else:
                            goBack = True
            else: # go back
                if idx == 0:
                    changed = False
                    goBack = False
                else:
                    d = gcd(nums[idx], nums[idx-1])
                    if d > 1:
                        nums[idx-1] = nums[idx] * nums[idx-1] // d
                        del nums[idx]
                        idx -= 1
                        backChanged = True
                    else:
                        goBack = False
                        changed = backChanged
                        backChanged = False

                

        return nums

